import React, { useState } from 'react';
import apiClient from '../api/apiClient';
import { useNavigate, Link } from 'react-router-dom';
import './register.css';

const Register: React.FC = () => {
  const [formData, setFormData] = useState({
    name: '',
    matricule: '',
    password: '',
    role: 'student',
    faculty: '',
  });
  const [error, setError] = useState<string | null>(null);
  const [success, setSuccess] = useState(false);
  const navigate = useNavigate();

  const handleChange = (e: React.ChangeEvent<HTMLInputElement | HTMLSelectElement>) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    setError(null);
    try {
      await apiClient.post('/auth/register', formData);
      setSuccess(true);
      setTimeout(() => navigate('/index'), 2000);
    } catch (err: any) {
      setError(err.response?.data?.message || 'Erreur lors de l\'inscription');
    }
  };

  return (
    <div className="register-container">
      <div className="register-card">
        <h2 className="register-title">Inscription</h2>
        
        {error && <p className="error-message">{error}</p>}
        {success && <p className="success-message">Inscription réussie ! Redirection...</p>}
        
        <form onSubmit={handleSubmit} className="register-form">
          <div className="form-group">
            <label htmlFor="name" className="form-label">Nom complet</label>
            <input
              id="name"
              name="name"
              type="text"
              className="form-input"
              value={formData.name}
              onChange={handleChange}
              required
            />
          </div>
          
          <div className="form-group">
            <label htmlFor="matricule" className="form-label">Matricule</label>
            <input
              id="matricule"
              name="matricule"
              type="text"
              className="form-input"
              value={formData.matricule}
              onChange={handleChange}
              required
            />
          </div>
          
          <div className="form-group">
            <label htmlFor="password" className="form-label">Mot de passe</label>
            <input
              id="password"
              name="password"
              type="password"
              className="form-input"
              value={formData.password}
              onChange={handleChange}
              required
            />
          </div>
          
          <div className="form-group">
            <label htmlFor="role" className="form-label">Rôle</label>
            <select
              id="role"
              name="role"
              className="form-select"
              value={formData.role}
              onChange={handleChange}
            >
              <option value="student">Étudiant</option>
              <option value="teacher">Professeur</option>
              <option value="admin">Administrateur</option>
            </select>
          </div>
          
          <div className="form-group">
            <label htmlFor="faculty" className="form-label">Faculté</label>
            <input
              id="faculty"
              name="faculty"
              type="text"
              className="form-input"
              value={formData.faculty}
              onChange={handleChange}
              required
            />
          </div>
          
          <button type="submit" className="submit-button">S'inscrire</button>
        </form>
        
        <div className="nav-link">
          Déjà inscrit ? <Link to="/login">Connectez-vous</Link>
        </div>
      </div>
    </div>
  );
};

export default Register;
